import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Aggregate extends Component {
    render() {
        return (
            <div style={{width: "40%", display: 'inline-block'}}>
                <h2 style={{color: '#fff'}}>Number Text</h2>
            </div>
        );
    }
}

class Filter extends Component {
    render() {
        return (
            <div>
                <img/>
                <input type="text"/>
                Filter
            </div>
        );
    }
}

class App extends Component {
  render() {
    return (
        <body background="http://static.tumblr.com/jw8fmba/RqUluoxaa/309560.jpeg">
            <div className="App">
                <h1>Title</h1>
                <Aggregate/>
                <Aggregate/>
                <Filter/>
            </div>
        </body>
    );
  }
}
export default App;
